const Films = () => {

    const [Data, setData] = useState({
        Message: '',
        Films: ''
    })


    useEffect(() => {
        axios.get('https://www.swapi.tech/api/films/')
            .then(res => {
                console.log('Response from main API: ', res);
                console.log('This is the message: ', res.data.message);
                console.log('These are the films: ', res.data.result.foreach(film => film.properties.title));
                setData({
                    Message: res.data.message,
                    Films: res.data.result
                })
            })
            .catch(err => {
                console.log(err);
            })
    }, [])

    return (
        <>
            <p>{Data.Message}</p>
        </>

